const authaxios = axios.create({
  baseURL: apiurl,
  headers: {
    Authorization: `Bearer ${accesstoken}`,
    AuthToken: 'bd8382d5-3adf-11eb-9263-b62d5e046812'
  }
})

const CardDetails = () => {

  const [ events, setevents ] = useState([]);
  const [ requestError, setRequestError ] = useState();
  let date = '31-12-2021';

  console.log(events);
